import React from 'react';

import Display from '../Display/Display';

import {
  OutputContainer
} from './OutputStyles';

const Output = ({ text, translatedText }) => (
  <OutputContainer>
    <Display heading="Original text" outputText={text}/>
    <Display heading="Translated text" outputText={translatedText}/>
  </OutputContainer>
)

export default Output;
